import React, { Component } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';


import Chip from '@material-ui/core/Chip';
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';



const topSinistres = [
  { title: 'Vole' },
  { title: 'Bris de glace' },
  { title: 'Vol d/Accessoires' },
  { title: 'Sinistres corporels' },
  { title: 'Recours' },
 
  ]

  const topAssurance = [
  { title: 'AXA' },
  { title: 'SAHAM' },
  { title: 'Gras Savoye' },
  { title: 'NSIA' },
  { title: 'ASSUR'},
 
  ]


class Form1 extends Component {
  render() {
    return(
      <div >
       

       <React.Fragment>
        <CssBaseline />
		      <Container fixed>
                 <Paper>
		      		<div >

					      <Grid container spacing={3}>
					        <Grid item xs={12}>
						         

					        </Grid>
					        <Grid item xs={6}>
					          
                            
                             
                           

                           			<div style={{ width: 500 }}>
                           			<h5>Type de sinitre</h5>
								      <Autocomplete
								        multiple
								        id="tags-outlined"
								        options={topSinistres}
								        getOptionLabel={option => option.title}
								        defaultValue={[topSinistres[3]]}
								        filterSelectedOptions
								        renderInput={params => (
								          <TextField
								            {...params}
								            variant="outlined"
								            label="Selection Multiple"
								            placeholder="Selectionner votre sinistre"
								            margin="normal"
								            fullWidth
								          />
								        )}
								      />
                                 </div>

					          
					        </Grid>
					        <Grid item xs={6}>
					       <div style={{ width: 500 }}>
                           			<h5>Votre Assurance</h5>
								      <Autocomplete
								        multiple
								        id="tags-outlined"
								        options={topAssurance}
								        getOptionLabel={option => option.title}
								        defaultValue={[topAssurance[3]]}
								        filterSelectedOptions
								        renderInput={params => (
								          <TextField
								            {...params}
								            variant="outlined"
								            label="Selection Multiple"
								            placeholder="Selectionner votre Assurance"
								            margin="normal"
								            fullWidth
								          />
								        )}
								      />
                                 </div>
					          
								      
					        </Grid>
					        <Grid item xs={12}>
					         
                            
						       <div style={{ width: 300 }}>
						        <TextField
						          id="outlined-basic"
						          label="Outlined"
						          margin="normal"
						          variant="outlined"
						        />
						      </div>
                                 
                                
                                  
					          
					        </Grid>
					        <Grid item xs={3}>
					         
					        </Grid>
					        <Grid item xs={3}>
					        
					        </Grid>
					        <Grid item xs={3}>
					          
					        </Grid>
					      </Grid>
  					  </div>

		   


                </Paper>
		      </Container>
    </React.Fragment>
       
        </div>
    )
  }
}

export default Form1;
